import Button from "./Button";
import style from "./Navbar.module.css";

const Navbar = (props) => {
  return (
    <div className={style["navbar-bar"]}>
      <div className={style["navbar-textcontainer"]}>Leif's</div>
      <Button></Button>
    </div>
  );
};

export default Navbar;
